import React from 'react';

function Menu() {
  // Menu component content
  return <nav>{/* Menu items */}</nav>;
  <div style={{ overflow: 'hidden', paddingBottom: '56.25%', position: 'relative', height: 0 }}>
  <iframe
    src={vimeoUrl}
    style={{
      left: 0,
      top: 0,
      height: '100%',
      width: '100%',
      position: 'absolute',
    }}
    frameBorder="0"
    allow="autoplay; fullscreen; picture-in-picture"
    allowFullScreen
    title="Vimeo Video"
  ></iframe>
</div>
}

export default Menu;
